import React from 'react'
import ArticleList from './ArticleList'
import articles from '../fixtures'
import 'bootstrap/dist/css/bootstrap.css'

function App() {
    return (
        <div className="container">
            <h1>App name</h1>
            <ArticleList articles = {articles} />
        </div>
    )
}
export default App
